import React from 'react'
// import {Route, Router,Switch} from 'react-router-dom';
import styled from 'styled-components';


function Navbar() {
    return (
        
        <div>
            <Nav>
            <div className="logo">
                Marketution
            </div>

        <ul>
            <li>HOME</li>
            <li>BUY A COURSE</li>
            <li>EXPLORE COURSE</li>
            <li>LOGIN</li>
            <li>CREATE ACCOUNT</li>
        </ul>

        </Nav>


        </div>
    )
}

export default Navbar
